import "./NavBar.css";

function BarraNavegacion(props) {
    return (
        <div className="header">
            <nav className="header-nav">
                <ul className="header-nav-ul">
                    <li>{props.a} Uno</li>
                    <li>{props.a} Dos</li>
                    <li>{props.a} Tres</li>
                    <li>{props.a}Cuatro</li>
                </ul>
            </nav>
        </div>
    )
}

export default BarraNavegacion;
